function bwd = backward_rate_prec(obj,temp)

  bwd = zeros(6,length(temp));

  % disp('size(bwd_rate_high) = ')
  %   disp(size(bwd_rate_high(temp(1000<=temp && temp<=3500))))

  bwd(:,(300<=temp)&(temp<=1000)) = bwd_rate_low(temp((300<=temp)&(temp<=1000)));
  bwd(:,(1000<temp)&(temp<=3500)) = bwd_rate_high(temp((1000<temp)&(temp<=3500)));
end

